import React from "react";
import setting from "../setting.svg";
import search from "../search.svg";
import dp from "../dp.png";

export default function ChatHeader() {
  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        padding: "8px",
        paddingLeft: "12px",
        paddingRight: "12px",
      }}
    >
      <img
        src={dp}
        style={{
          height: "40px",
          width: "40px",
          borderRadius: "50%",
          marginRight: "15px",
        }}
      />
      <div>
        <p style={{ margin: "0", padding: "0" }}>Name</p>
        <p style={{ margin: "0", padding: "0" }}>Online</p>
      </div>

      <div
        style={{ display: "flex", alignItems: "center", marginLeft: "auto" }}
      >
        <img
          src={search}
          style={{
            height: "25px",
            width: "25px",
          }}
        />

        <img
          className="icons btn btn-secondary dropdown-toggle"
          src={setting}
          data-bs-toggle="dropdown"
          aria-expanded="true"
          style={{
            height: "25px",
            width: "25px",
            marginLeft: "20px",
          }}
        />
      </div>
    </div>
  );
}
